import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';

// Features Data
const features = [
  "Comprehensive Courses",
  "Interactive Lessons",
  "Expert Instructors",
  "24/7 Support"
];

// Featured Courses Data
const courses = [
  { title: "React Development", description: "Learn the basics and advanced topics of React.js.", link: "/courses/react" },
  { title: "Data Science with Python", description: "Master data analysis and machine learning techniques.", link: "/courses/data-science" }
];

// Testimonials Data
const testimonials = [
  { text: "This platform helped me improve my grades. The courses are amazing!", author: "- Student A" },
  { text: "I love the interactive lessons and expert instructors!", author: "- Student B" }
];

function HomePage() {
  return (
    <div className="home-container">
      <header className="home-header">
        <h1>Welcome to the Education Platform</h1>
        <p>Learn, Grow, and Achieve your academic goals with us!</p>
        <div className="cta-buttons">
          <Link to="/login"><button className="cta-button">Login</button></Link>
          <Link to="/dashboard"><button className="cta-button">Go to Dashboard</button></Link>
        </div>
      </header>

      {/* Features Section */}
      <section className="features-section">
        <h2>Our Features</h2>
        <ul>
          {features.map((feature, index) => (
            <li key={index}>{feature}</li>
          ))}
        </ul>
      </section>

      {/* Featured Courses Section */}
      <section className="featured-courses">
        <h2>Featured Courses</h2>
        <div className="courses-grid">
          {courses.map((course, index) => (
            <div className="course-card" key={index}>
              <h3>{course.title}</h3>
              <p>{course.description}</p>
              <Link to={course.link}><button className="cta-button">Learn More</button></Link>
            </div>
          ))}
        </div>
      </section>

      {/* Testimonials Section */}
      <section className="testimonials-section">
        <h2>What Our Students Say</h2>
        <div className="testimonials-grid">
          {testimonials.map((testimonial, index) => (
            <div className="testimonial" key={index}>
              <p>"{testimonial.text}"</p>
              <p>{testimonial.author}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Newsletter Section */}
      <section className="newsletter-section">
        <h2>Stay Updated</h2>
        <p>Sign up for our newsletter to get the latest updates on courses, events, and more.</p>
        <form>
          <input type="email" placeholder="Enter your email" required />
          <button type="submit" className="cta-button">Subscribe</button>
        </form>
      </section>

      {/* Image Section */}
      <section className="image-section">
        <img src="https://via.placeholder.com/600x300" alt="Education" loading="lazy" />
      </section>

      {/* Footer */}
      <footer className="footer">
        <ul>
          <li><Link to="/privacy-policy">Privacy Policy</Link></li>
          <li><Link to="/terms">Terms of Service</Link></li>
          <li><a href="https://facebook.com">Facebook</a></li>
          <li><a href="https://twitter.com">Twitter</a></li>
        </ul>
      </footer>
    </div>
  );
}

export default HomePage;
